import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  width: 100%;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  background-color: red;

  form {
    margin-top: 24px;

    input {
      margin-right: 8px;
    }
  }
  .single {
    margin-bottom: 8px;
  }
`;
